// Ends here


const cooldowns = new Discord.Collection();

client.on('message', message => {
	if (!message.content.startsWith(prefix) || message.author.bot) return;
	if (message.content.startsWith(`${prefix}reload`)) {
		clearRequire.all()

		try {
            const loadup2 = async () => {
                const commandFolders = fs.readdirSync('./commands');
                for (const folder of commandFolders) {
                  const commandFiles = fs.readdirSync(`./commands/${folder}`).filter(file => file.endsWith('.js'));
                  for (const file of commandFiles) {
                    const command = require(`./commands/${folder}/${file}`);
                    client.commands.set(command.name, command);
                    console.log("Loaded ".brightBlue + command.name.brightGreen)
                  }
                }    
              };
            loadup2()
			const embed = new Discord.MessageEmbed()
            .setColor('#00ff00')
            .setTitle(`All commands have been reloaded!`)
            message.channel.send(embed);
		} catch (error) {
			console.error(error);
            const embed = new Discord.MessageEmbed()
            .setColor('#FF0000')
            .setTitle('Reload failed!')
            .setDescription(`${error.message}`)
            message.channel.send(embed);
		}
	  }

	const args = message.content.slice(prefix.length).trim().split(/ +/);
	const commandName = args.shift().toLowerCase();

	const command = client.commands.get(commandName)
		|| client.commands.find(cmd => cmd.aliases && cmd.aliases.includes(commandName));

	if (!command) return;

	if (command.guildOnly && message.channel.type === 'dm') {
		return message.reply('I can\'t execute that command inside DMs!');
	}

	if (command.permissions) {
		const authorPerms = message.channel.permissionsFor(message.author);
		if (!authorPerms || !authorPerms.has(command.permissions)) {
			return message.reply('You can not do this!');
		}
	}

	if (command.args && !args.length) {
		let reply = `You didn't provide any arguments, ${message.author}!`;

		if (command.usage) {
			reply += `\nThe proper usage would be: \`${prefix}${command.name} ${command.usage}\``;
		}

		return message.channel.send(reply);
	}

	if (!cooldowns.has(command.name)) {
		cooldowns.set(command.name, new Discord.Collection());
	}

	const now = Date.now();
	const timestamps = cooldowns.get(command.name);
	const cooldownAmount = (command.cooldown || 3) * 1000;

	if (timestamps.has(message.author.id)) {
		const expirationTime = timestamps.get(message.author.id) + cooldownAmount;

		if (now < expirationTime) {
			const timeLeft = (expirationTime - now) / 2500;
			return message.reply(`Please wait ${timeLeft.toFixed(1)} more second(s) before reusing the \`${command.name}\` command.`);
		}
	}

	timestamps.set(message.author.id, now);
	setTimeout(() => timestamps.delete(message.author.id), cooldownAmount);

	try {
		command.execute(message, args);
	} catch (error) {
		console.error(error);
		message.reply('There was an error trying to execute that command!');
		hastebin(error, { url: "https://bin.enderdigital.co.uk", extension: "txt" }).then(haste => {
			// Logs the created hastebin url to the console
			console.log("Error Occured!".brightRed)
			console.log("Log: ".brightBlue + haste.brightGreen); // https://paste.example.com/someid.txt
			console.log("For support open a ticket on our discord and post the URL above!".brightYellow);
			console.log("Discord: https://discord.gg/gEFWU3WTJj".brightBlue)
		}).catch(error => {
			// Handle error
			console.error(error.brightRed);
		});
	}
});
client.once('ready', () => {
	var guildcount = client.guilds.size
	loadup()
	console.log('Ready!'.brightGreen);
});
client.login(config.token);
